import React, { Component } from 'react';
import {Link} from 'react-router-dom';

class Home extends Component {
    render() {
        return (
            <div>
                <h1>Bienvenidos</h1>
                <hr>
                </hr>
                <Link className="btn btn-primary mt-2" to="Inicio de Sesión" role="button">Iniciar Sesión</Link>
               <Link className="btn btn-primary mt-2" to="Formulario" role="button">Registar</Link>
            </div>
        )
    }
}

export default Home;
